css:
.autocomplete.select-list {
  box-sizing: content-box;
  margin-left: 0;
}
.autocomplete.select-list ol li {
  padding: 5px 0 5px 0;
}
.autocomplete ol {
  box-sizing: content-box;
  position: relative;
  overflow-y: scroll;
  max-height: 200px;
}
.autocomplete span {
  padding-left: 5px;
  padding-right: 5px;
}
.autocomplete .error-message {
  margin: 2px;
}
